import React from 'react';
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';
import '../App.css';


function GraphLine() {

    const parameters = {
        title: {
            text: 'My stock chart'
          },
        series: [
            {
            name: "histogram",
            data: [100, 200, 30, 100, 50, 30], 
            }
        ],
        chart: [
            {
            type: 'par semaine',
            }
        ]
    }

    return (
        <div>
            <HighchartsReact 
            highcharts={Highcharts} 
            options={parameters} />

            

        </div>
        
        );
    
    }
        export default GraphLine

export const MyStockChart = () =>
    
    <HighchartsReact
    highcharts={Highcharts}
    constructorType={'stockChart'}
    options={parameters}/>
